import React, { Component } from 'react';
// import ReactDOM from "react-dom";
import './App.css';

class Header extends Component {
  render () {
    return(
      <div class="header">
        Chester, Cheshire
        <div class="subtitle"> 
          Through my eyes
        </div>
      </div>
    )
  }
}

class GridItem extends Component {
  render () {
    return(
      <div>This is a grid item</div>
    )
  }
}

class PlaceGrid extends Component {
  getData() {
    var data = [
      {
        "name": "Guilden Sutton"
      },
      {
        "name": "Chester Cathedral"
      }
    ];

    return data;
  }

  render () {
    let gridItems = [];
    let gridItemData = this.getData();

    for (var i = 0; i < gridItemData.length; i++) {
      gridItems.push(<GridItem id={i}> </GridItem>);
    }


    return(
      <div class="grid">
        {gridItems}
      </div>
    )
  }
}

class App extends Component {

  render() {
    return(
      <div>
        <Header /> 
        <PlaceGrid /> 
      </div>
    )
  }
}

export default App;
